		"text": "주인님과 댕댕이 케미🐾🧡\n#최수영 X #강태오 의 티저 촬영 현장!\n\n언제나 단아만을 바라보는 영화(강태오)와\n시크하지만 어느새 영화에게 스며드는 단아(최수영)\n꽁냥 꽁냥(◞♥ꈍ∇ꈍ)◞♥\n\n서로를 향하는 완주 로맨스 드라마 &lt;#런온&gt;\n12월 16일 수요일 밤 9시 첫 방송💨\n#서단아 #이영화 #단화커플 https://t.co/SGEbB2qmdC"
