		"text": "독특하고 신기한 글씨체인것도 잠시지 오피셜 공지를 왜 유니코드를 써서 하느냔 말이야. 이런 마케터나 소셜담당자는 좋게 보이지 않음. 인스타에서 유행 타는 것도 보기 싫은데 왜 다른 곳까지 가져다 쓰는 건지. 힙한게 아니라 세심하지 않아보여서 마이너스가 됨."
