		"text": "매순간 느끼지만 너무 많은 희망을 갖지도 믿음을 주지도 않으며 어떠한 사안을 맹목적으로  바라보지 않고 누군가의 말을 그대로 전달하지 않으며 비판하며 볼 줄 알고 직접 경험해본 가치에 중요성을 알며 배움을 멈추지 않는 삶."
